  <div id="header">
    <p class="divNaka">Yu0 戦争サーバー</p>
  </div><div class="rainborder"></div>
  <h1 style="text-align: center">Yuu war server</h1>
  <div id="wrap">
    <div id="left">
      <h3>統合版の方向けの<br>サーバー</h3>
      <p>
        Yuu warsは統合版向けですが、クロスプレイのためJava版の方でも参加可能です。<br>
        自由度を奪わずに現実味を出すため、様々な要素を入れています。<br>
        チート対策プラグイン、窃盗・荒らし対策・復元・犯人特定プラグイン、大砲や銃などの戦争関係プラグイン<br>
        などが導入されています。
      </p>
